    private static BigInteger generateNext(BigInteger current) {
        BigInteger a = BigInteger.valueOf(10).pow(log10(current) + 1);
        BigInteger result = current;
        while (true) {
            result = result.add(a);
            if (isGreenNumber(result)) return result;
        }
    }

    private static boolean isGreenNumber(BigInteger n) {
        BigInteger square = n.pow(2);
        BigInteger divider = BigInteger.valueOf(10).pow(log10(n) + 1);
        BigInteger remainder = square.remainder(divider);
        return remainder.equals(n);
    }

    //https://stackoverflow.com/questions/18828377/biginteger-count-the-number-of-decimal-digits-in-a-scalable-method/18828536
    private static int log10(BigInteger huge) {
        int digits = 0;
        int bits = huge.bitLength();
        // Serious reductions.
        while (bits > 4) {
            // 4 > log[2](10) so we should not reduce it too far.
            int reduce = bits / 4;
            // Divide by 10^reduce
            huge = huge.divide(BigInteger.TEN.pow(reduce));
            // Removed that many decimal digits.
            digits += reduce;
            // Recalculate bitLength
            bits = huge.bitLength();
        }
        // Now 4 bits or less - add 1 if necessary.
        if (huge.intValue() > 9) {
            digits += 1;
        }
        return digits;
    }
